      // SPACING\n\n      // AVATAR\n      .user-avatar {\n        position: relative;\n        height: $avatar-height;\n        width: $avatar-height;\n        img {\n          width: $avatar-height;\n          border-radius: $avatar-height;\n        }\n\n        .badge {\n          position: absolute;\n          bottom: 0;\n          right: 0;\n          height: $badge-height;\n          width: $badge-height;\n          border-radius: $badge-height;\n          border: 2px solid white;\n\n          &.success { background-color: $success; }\n          &.danger { background-color: $danger; }\n        }\n      }\n\n      // ACTION BUTTON\n      .action-button {\n        @extend %action-button;\n\n        \n        a {\n          display: inline-block;\n          width: $action-button-height;\n          height: $action-button-height;\n          display: flex;\n          flex-flow: column nowrap;\n          align-items: center;\n          justify-content: center;\n\n          .material-icons {\n            font-size: 2.5rem;\n            color: white;\n          }\n        }\n      }\n    }\n\n    /* ----------------------------- GREETING BLOCK ----------------------------- */\n    .greeting-block {\n      padding-left: 1rem;\n      \n      height: 4.5rem;\n      display: flex;\n      flex-flow: row nowrap;\n      align-items: center;\n      justify-content: flex-start;\n\n      h1 {\n        @include mobile-text('h1');\n        font-weight: 600;\n        letter-spacing: -0.13rem;\n      }\n    }\n\n    /* ---------------------- OTHER OPTIONS AKA SEARCH ETC. --------------------- */\n    .other-actions-block {\n      width: 100%;\n      .input-field-wrapper {\n        padding-top: 1.5rem;\n        width: inherit;\n        .form-group {\n          position: relative;\n          input {\n            border-radius: $search-field-height;\n            height: $search-field-height;\n            padding-left: 4rem;\n            font-weight: 500;\n            font-size: 1.6rem !important;\n            letter-spacing: 0rem;\n            -webkit-font-smoothing: antialiased !important;\n\n            &::placeholder {\n              padding-left: 0.5rem;\n            }\n          }\n\n          .prefix-icon {\n            position: absolute;\n            left: 1rem;\n            display: flex;\n            flex-flow: column nowrap;\n            align-items: center;\n            justify-content: center;\n            height: 100%;\n            \n\n            .material-icons {\n              display: inline-block;\n              color: $steel-regular;\n\n              &.focused {\n                color: $canary-regular;\n              }\n            }\n          }\n        }\n      }\n    }\n  }\n\n  .short-nav {\n    @include style-bg('light');\n    .short-nav-content {\n      @include auto-width-mobile;\n      display: flex;\n      flex-flow: row nowrap;\n      align-items: center;\n      justify-content: space-between;\n\n      .user-image {\n        img {\n          width: $avatar-height;\n          border-radius: $avatar-height;\n        }\n      }\n      .form-group {\n        width: 100%;\n        padding-left: 2rem;\n        padding-right: 2rem;\n        input {\n          height: calc($avatar-height + 1rem);\n          border-radius: $avatar-height;\n        }\n      }\n\n      .action-button {\n        @extend %action-button;\n\n        a {\n          display: inline-block;\n          width: $action-button-height;\n          height: $action-button-height;\n          display: flex;\n          flex-flow: column nowrap;\n          align-items: center;\n          justify-content: center;\n\n          .material-icons {\n            font-size: 2rem;\n            color: white;\n          }\n        }\n      }\n    }\n  }\n\n}\n\n.top-nav.dark {\n  background-image: unset;\n  // color: red;\n  color: $steel-regular;\n  @include style-bg('dark');\n  .top-nav-content {\n    .user-action-block {\n      .user-avatar {\n        .badge {\n         